schemaDefinition: "create or replace view U_PROCESS_REPORT_SUMMARY_INTVW_0709(\n\t\
  U_CUSTOMER,\n\tSYS_ID,\n\tSYS_UPDATED_ON,\n\tU_APPROVERS,\n\tSYS_CREATED_ON,\n\t\
  U_INSTANCE_NAME,\n\tSYS_CREATED_BY,\n\tU_INSTANCE_SERVER,\n\tSYS_TAGS,\n\tSYS_UPDATED_BY,\n\
  \tSYS_MOD_COUNT,\n\tU_USERS,\n\tU_REPORT_ID,\n\tU_PROCESS_USERS,\n\tU_INSTANCE_PORT,\n\
  \tU_END_USERS,\n\tPSP_PER_INSERT_DT,\n\tPSP_PER_UPDATE_DT,\n\tPSP_PER_DELETE_DT,\n\
  \tU_LOGGED_IN_365D_USER_COUNT,\n\tU_LOGGED_IN_90D_USER_COUNT,\n\tU_DISCOVERED_DEVICE_COUNT,\n\
  \tU_LOGGED_IN_USER_COUNT,\n\tU_DISCOVERED_SERVER_COUNT,\n\tU_ACTIVE_USER_COUNT,\n\
  \tU_DISCOVERED_NODE_COUNT,\n\tU_ACTIVE_NON_INTEG_NON_WS_USER_COUNT,\n\tU_LOGGED_IN_NON_INTEG_NON_WS_USER_COUNT,\n\
  \tU_LOGGED_IN_365D_NON_INTEG_NON_WS_USER_COUNT,\n\tU_STATUS,\n\tDV_U_STATUS,\n\t\
  U_SALES_REQUEST_NUMBER,\n\tU_REPORT_TYPE\n) as\nSELECT * FROM RDS_SHARE.DATACENTER.\"\
  U_PROCESS_REPORT_SUMMARY\"\nunion\nselect u_customer, sys_id, sys_updated_on, u_approvers,\
  \ sys_created_on, u_instance_name, sys_created_by, u_instance_server, sys_tags,\n\
  sys_updated_by, sys_mod_count, u_users, u_report_id, u_process_users, u_instance_port,\
  \ u_end_users, 'random' as  PSP_PER_INSERT_DT,\n'random' as PSP_PER_UPDATE_DT,'random'\
  \ as PSP_PER_DELETE_DT,\ncast(case when u_logged_in_365d_user_count = 'random' then\
  \ 'random' else u_logged_in_365d_user_count end as NUMBER('random','random')) as\
  \ u_logged_in_365d_user_count,\ncast(case when u_logged_in_90d_user_count = 'random'\
  \ then 'random' else u_logged_in_90d_user_count end as NUMBER('random','random'))\
  \ as u_logged_in_90d_user_count,\ncast(case when u_discovered_device_count = 'random'\
  \ then 'random' else u_discovered_device_count end as NUMBER('random','random'))\
  \ as u_discovered_device_count,\ncast(case when u_logged_in_user_count = 'random'\
  \ then 'random' else u_logged_in_user_count end as NUMBER('random','random')) as\
  \ u_logged_in_user_count,\ncast(case when u_discovered_server_count = 'random' then\
  \ 'random' else u_discovered_server_count end as NUMBER('random','random')) as u_discovered_server_count,\n\
  cast(case when u_active_user_count = 'random' then 'random' else u_active_user_count\
  \ end as NUMBER('random','random')) as u_active_user_count,\ncast(case when u_discovered_node_count\
  \ = 'random' then 'random' else u_discovered_node_count end as NUMBER('random','random'))\
  \ as u_discovered_node_count,\nu_active_non_integ_non_ws_user_count, u_logged_in_non_integ_non_ws_user_count,\
  \ u_logged_in_365d_non_integ_non_ws_user_count, u_status,\n'random' as DV_U_STATUS,\
  \ u_sales_request_number, u_report_type\nfrom EDW_LS.DATACENTER.U_PROCESS_REPORT_SUMMARY_INT_070923;"
